// Home.js

import React from "react";
import { Outlet, Link } from "react-router-dom";
import { IoHome } from "react-icons/io5";
import './Home.css';

const Home = () => {
    return (
        <>
            <header className="navbar">
                <div className="logo">
                    <Link className="link dim blue dib mr3" to="/Home" title="Home">
                        <span className="home-text">Home</span>
                    </Link>
                </div>
                <nav className="navbar-menu">
                    <Link className="link dim blue dib mr3" to="/StudentLogin">Student</Link>
                    <div className="dropdown link blue dib mr3">
                        <label className="dropbtn">Landlord</label>
                        <div className="dropdown-content">
                            <Link to="/LandlordLogin">Login</Link>
                            <Link to="/LandlordSignup">Signup</Link>
                        </div>
                    </div>
                    <Link className="link dim blue dib mr3" to="/WardenLogin">Warden</Link>
                    <Link className="link dim blue dib mr3" to="/AdminLogin">Admin</Link>
                </nav>
            </header>
            <Outlet />
        </>
    );
}

export default Home;
